import {Fragment} from 'react';

import mealsImage from '../../assets/Meals.jpg';

const Header = (props) => {
    return <Fragment>
        <header>
            <h1>React Meals</h1>
            <button>cart</button>
        </header>
        <div>
            <img src={mealsImage}/>
        </div>
    </Fragment>
};

export default Header;
